import unittest
from fuelInjectionPerfection import solution

class TestSolution(unittest.TestCase):
	def test_a(self):
		self.assertEqual(solution('15'), 5)
	
	def test_b(self):
		self.assertEqual(solution('4'), 2)
	
	def test_c(self):
		self.assertEqual(solution('1024'), 10)
	
	def test_d(self):
		self.assertEqual(solution('2147483647'), 32)
	
	def test_e(self):
		self.assertEqual(solution('1026'), 11)
	
	def test_f(self):
		self.assertEqual(solution('1030'), 12)

	def test_g(self):
		self.assertEqual(solution(''), 1367)
	
	def test_h(self):
		self.assertEqual(solution('1'), 0)

	def test_i(self):
		self.assertEqual(solution(''), 1278)

